<br>When Fuwa', CHAR(39), 's companions, the aliens Lala Hagoromo and Prunce, arrive on Earth, they declare that they are searching for the Precure, legendary warriors who will save the universe. But an organization known as the Notraiders soon follows and attacks, intending to capture Fuwa and its power. Overcome by a desire to protect Fuwa, Hikaru finds herself transforming into "Cure Star," one of the Precure that Lala and the others have been searching for!<br>
<br>It is now up to Hikaru and the rest to fend off the Notraiders', CHAR(39), ' onslaught, discover the rest of the Precure, and find the Star Color Pens, artifacts that will awaken the 12 Star Princess who keep the universe in balance.<br>
